function ProjectHopes:Setup_Plater()
	if not E:IsAddOnEnabled('Plater') then Private:Print('Plater ' .. L["is not installed or enabled."]) return end
	-- Globals
	local Plater = _G.Plater
	local DF = _G.DetailsFramework
			
	if not self:IsHooked(Plater, "RefreshConfigProfileChanged") then 
		self:RawHook(Plater, "RefreshConfigProfileChanged", function()
			Plater:RefreshConfig()
		end)
	end
			
	if not self:IsHooked(Plater, "OnProfileCreated") then
		self:RawHook(Plater, "OnProfileCreated", function()
			Plater.ImportScriptsFromLibrary()
			Plater.ApplyPatches()
			Plater.CompileAllScripts("script")
			Plater.CompileAllScripts("hook")
			Plater.db.profile.use_ui_parent = true
			Plater.db.profile.ui_parent_scale_tune = 1 / E.global.general.UIScale
			Plater:RefreshConfig()
			Plater.UpdatePlateClickSpace()
		end)
	end
			
	platerProfile = platerProfile
	local profile = Plater.DecompressData(platerProfile, "print")
	Plater.db:SetProfile(name)
	Plater.db:ResetProfile(false, true)
	DF.table.copy(Plater.db.profile, profile)
	Plater.RestoreProfileCVars()
	_G.PlaterDB.captured_casts = {}
	_G.PlaterDB.captured_spells = {}
			
	if self:IsHooked(Plater, "RefreshConfigProfileChanged") then
		self:Unhook(Plater, "RefreshConfigProfileChanged") 
	end

	if self:IsHooked(Plater, "OnProfileCreated") then 
		self:Unhook(Plater, "OnProfileCreated") 
	end

	Private:Print(L["Plater profile has been set."])
end
	
function ProjectHopes:Plater_Private()
	if not _G.Plater then
		return 
	end
	
	local Plater = _G.Plater
	Plater.db:SetProfile(name)
	Plater.RestoreProfileCVars()
end
